import React from 'react';

import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';

export default function Component(props) {

  const [directCost, setDirectCost] = useState();
  const [indirectCost, setIndirectCost] = useState();
  const [intangibleCost, setIntangibleCost] = useState();
  const [opportunityCost, setOpportunityCost] = useState();
  const [potentialRiskCost, setPotentialRiskCost] = useState();

  let history = useHistory();

  const handleSubmit = async () => {

    const json = JSON.stringify({
      "directCost": directCost,
      "indirectCost": indirectCost,
      "intangibleCost": intangibleCost,
      "opportunityCost": opportunityCost,
      "potentialRiskCost": potentialRiskCost
    });

    let status = await service.loginUser(json);
    event.preventDefault();

    if(status != "") {
      history.push("/input");
    }
    else {
      alert("An account with that username and password could not be found.");
    }

  }

  const onChangeUsername = (event) => {
    setUsermame(event.target.value);
  }
  const onChangePassword = (event) => {
    setPassword(event.target.value);
  }

  return (
    <section>
      <Container maxWidth="xs">
        <Box pt={8} pb={10}  align="right">
          <Box mb={3} textAlign="center">
            <Typography variant="h5" component="h2">Cost Streams</Typography>
          </Box>
          <Box>
            <form noValidate>
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField variant="outlined" required fullWidth name="directCost" id="directCost" label="Direct Cost"/>
                </Grid>
                <Grid item xs={12}>
                  <TextField variant="outlined" required fullWidth name="indirectCost" id="indirectCost" label="Indirect Cost"/>
                </Grid>
                <Grid item xs={12}>
                  <TextField variant="outlined" fullWidth name="intangibleCost" id="intangibleCost" label="Intangible Cost"/>
                </Grid>
                <Grid item xs={12}>
                  <TextField variant="outlined" fullWidth name="opportunityCost" id="opportunityCost" label="Opportunity Cost"/>
                </Grid>
                <Grid item xs={12}>
                  <TextField variant="outlined" fullWidth name="potentialRiskCost" id="potentialRiskCost" label="Potential Risk Cost"/>
                </Grid>
              </Grid>
            </form>
          </Box>
        </Box>
      </Container>
    </section>
  );
}
